import React from 'react'
import TeamMenber from './TeamMember';

function Team() {
    return (
        <div className = "row">
            <TeamMenber 
            info = {
                {
                    name: "hassan",
                    position: "Nagaf",
                    phone: "+964 307802489",
                    emaile:"website@email.com",
                }
            } />
            <TeamMenber name = 'hassan'/>
            <TeamMenber name = 'Ameer'/>
        </div>
        
    )
}

export default Team;
